import React from 'react';

import { Container, Header, BackIcon, ProfileInfo } from './styles';

const Main: React.FC = () => {
  return (
        <Container>
            <Header>
                <button>
                    <BackIcon />
                </button>

                <ProfileInfo>
                    <strong>Juan Andrade</strong>
                    <span>90 tweets</span>
                </ProfileInfo>
            </Header>

            {/* foto de perfil */}

            <BottonMenu>
                <HomeIcon />
                <SearchIcon />
                <BellIcon />
                <DmIcon />
            </BottonMenu>

        </Container>
    );
}

export default Main;
